	('e824a78b-8f77-3a1f-a4f5-7cf5654f76f2','السيف  ذ.م.م','0013','https://lorempixel.com/640/480/?17105','هنالك العديد من الأنواع المتوفرة لنصوص لوريم إيبسوم، ولكن الغالبية تم تعديلها بشكل ما عبر إدخال بعض النوادر أو الكلمات العشوائية إلى النص. إن كنت تريد أن تستخدم نص لوريم إيبسوم ما، عليك أن تتحقق أولاً أن ليس هناك أي كلمات أو عبارات محرجة أو غير .',28.6884,42.751878,NULL,'6142','https://lorempixel.com/640/480/?58153','mohammad.hadi','890920.814.9751 x81201','977+1671927166696','376yflefel@karam.sa','2020-03-10 11:44:37','2020-03-10 11:44:37',NULL),
	('ec164998-d07d-3c5b-bb88-3c0c359a21c4','مجموعة المشيقح للمساهمة المحدودة','0001','https://lorempixel.com/640/480/?93200','هنالك العديد من الأنواع المتوفرة لنصوص لوريم إيبسوم، ولكن الغالبية تم تعديلها بشكل ما عبر إدخال بعض النوادر أو الكلمات العشوائية إلى النص. إن كنت تريد أن تستخدم نص لوريم إيبسوم ما، عليك أن تتحقق أولاً أن ليس هناك أي كلمات أو عبارات محرجة أو غير .',31.208677,29.934045,'Sidi Gaber','4642','https://lorempixel.com/640/480/?61464','mutaz76','0511111113','517+3869748776472','130saleem75@hotmail.com','2020-03-10 11:44:35','2020-03-10 11:44:35',NULL),
	('f1d58002-4d4a-3c12-be55-27da898016ca','معرض الماجد مساهمة عامة','0005','https://lorempixel.com/640/480/?29938','خلافاَ للإعتقاد السائد فإن لوريم إيبسوم ليس نصاَ عشوائياً، بل إن له جذور في الأدب اللاتيني الكلاسيكي منذ العام 45 قبل الميلاد، مما يجعله أكثر من 2000 عام في القدم. قام البروفيسور \"ريتشارد ماك لينتوك\" (Richard McClintock) وهو بروفيسور اللغة اللاتينية في جامعة هامبدن-سيدني في فيرجينيا.',20.622905,42.864343,'Rania','9525','https://lorempixel.com/640/480/?51549','samer.shami','552736-379-9386 x08905','628+1181244904583','800saleem.jabri@gmail.com','2020-03-10 11:44:35','2020-03-10 11:44:35',NULL),
	('f2db155c-357a-3934-90db-5a046f8fe1c4','أكاديمية السيف وأولاده','0014','https://lorempixel.com/640/480/?14268','هناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء لصفحة ما سيلهي القارئ عن التركيز على الشكل الخارجي للنص أو شكل توضع الفقرات في الصفحة التي يقرأها. ولذلك يتم استخدام طريقة لوريم إيبسوم لأنها تعطي توزيعاَ طبيعياَ -إلى حد ما- للأحرف عوضاً عن استخدام \"هنا يوجد محتوى نصي، هنا يوجد محتوى نصي\" فتجعلها تبدو (أي الأحرف) وكأنها نص مقروء.',20.476016,42.672421,'Rania','8389','https://lorempixel.com/640/480/?65420','mohammad.shami','914247.945.2545','1092+7311953741040','155flefel.akram@jabri.sa','2020-03-10 11:44:37','2020-03-10 11:44:37',NULL),
