INSERT INTO `term_conditions` (`id`, `terms`, `type`, `created_at`, `updated_at`, `deleted_at`)
VALUES
	(1,'<p><strong>خصوصیتك تھمنا </strong></p>\r\n\r\n<p>1- الباحث عن عمل یظھر في الخارطة بین اصحاب العمل فقط ولا یمكن للباحثین عن عمل الاخرین مشاھدتھ ولا التواصل معھ</p>\r\n\r\n<p>2- لا یتم في التطبیق نشر ارقام الاتصال اوالبرید الإلكتروني الخاصة بالمستخدمین ، فقط الوسیلة الوحیده للتواصل تكون من خلال الضغط على زر التقدیم بطلب الوظیفة واذا رغب صاحب العمل التواصل مع الباحث عن عمل یكون من خلال زر المحادثة النصیھ في التطبیق فقط <strong>سیاسة المحادثة : </strong>- لایمكن المحادثة النصیھ بین الباحثین عن عمل مع بعضھم البعض - لایمكن المحادثة النصیھ من الباحث عن عمل مباشرة مع صاحب العمل فقط عن طریق الضغط على زر التقدیم بطلب الوظیفة لیقوم النظام باضافتھ ضمن المتقدمین على الوظیفة وارسال رسالة بشكل آلي الى شاشة المحادثة النصیھ الخاصة بصاحب العمل . - یحق لصاحب العمل المحادثة النصیھ مباشرة مع اي باحث عن عمل )توجد خاصیة الحظر / الابلاغ ( وبھذا تقع المسئولیة كاملھ على المستخدم نفسھ في حال قام بنشر ارقام الاتصال او البرید الالكتروني الخاصة بھ في التطبیق سواء في مربع الوصف المختصر للخبرات السابقة او في السیرة الذاتیة التي یقوم بارفاقھا او تزوید الاطراف الاخرى بھ اثناء المحادثة النصیھ او غیرھا ولا تتحمل ادارة التطبیق اي مسئولیة جراء ماینتج عنھا من اضرار.</p>\r\n\r\n<p>3- یعتمد التطبیق على الخارطة في تحدید موقع الوظائف وقرب الباحثین عن عمل منھا . لذا تم ترك حریة تحدید الموقع على الخارطة للمستخدم نفسھ سواء اختار تحدید موقعھ الفعلي او موقع اخر من خلال تحریك المؤشر على الخارطة . وبھذا یكون المستخدم ھو المسئول عن تحدید الموقع ولا تتحمل ادارة التطبیق اي مسئولیة جراء ذلك . ) للاستفادة من مزایا التطبیق في حال اختار المستخدم تحریك المؤشر الى موقع اخر نقترح ان یكون مكان عام قریب من موقعھ كحدیقة عامھ او ماشابھ(</p>\r\n\r\n<p><strong>موافقتك تعني الالتزام بالشروط التالیة : </strong></p>\r\n\r\n<p>- المصداقیة في تعبئة البیانات وتكون مسؤولا عن الصور والمحتوى الذي تقوم بنشره والتأكد من قانونیتھ وملاءمتھ. - أن تلتزم بعدم انتھاك حقوق وخصوصیة الاخرین وأن تكون جمیع رسائل المحادثة ضمن حدود الوظیفة )تحت طائلة المسئولیة( - في حال مخالفة الشروط یحق لادارة التطبیق ایقاف العضویة - یجب تحدیث البیانات اولا باول حتى لا یتم حذفھا</p>\r\n\r\n<p>تطبیق JOBZ AROUND الخدمة محمیة بموجب قانون العلامة التجاریة والقوانین الأخرى الخاصة بالمملكة العربیة السعودیة والدول الاخرى. لا یجوز استخدام علاماتنا التجاریة أو مظھرنا التجاري دون الحصول على موافقة خطیة .</p>',2,'2020-03-16 12:25:02','2020-03-26 21:40:59',NULL),
	(2,'<p><strong>خصوصیتك تھمنا </strong></p>\r\n\r\n<p>1- صاحب العمل یظھر في الخارطة بین الباحثین عن عمل فقط ولا یمكن لاصحاب العمل الاخرین مشاھدتھ ولا التواصل معھ</p>\r\n\r\n<p>2- لا یتم في التطبیق نشر ارقام الاتصال اوالبرید الإلكتروني الخاصة بالمستخدمین , الوسیلة الوحیده</p>\r\n\r\n<p>المتاحة للتواصل بین اصحاب العمل والباحثین عن عمل من خلال زر المحادثة النصیھ في التطبیق فقط .</p>\r\n\r\n<p><strong>سیاسة المحادثة : </strong></p>\r\n\r\n<p>-لا یمكن المحادثة بین اصحاب العمل مع بعضھم البعض - یحق لصاحب العمل المحادثة النصیھ مباشرة مع اي باحث عن عمل )توجد خاصیة الحظر/ الابلاغ( - لا یمكن المحادثة من الباحث عن عمل مباشرة مع صاحب العمل فقط عن طریق الضغط على زر التقدیم بطلب الوظیفة لیقوم النظام باضافتھ ضمن المتقدمین على الوظیفة وارسال رسالة بشكل آلي لشاشة المحادثة النصیھ الخاصة بصاحب العمل . وبھذا تقع المسئولیة كاملھ على المستخدم نفسھ في حال قام بنشر ارقام الاتصال او البرید الالكتروني الخاصة بھ في التطبیق سواء في مربع الوصف المختصر للوظیفة او تزوید الاطراف الاخرى بھ اثناء المحادثة النصیھ او غیرھا ولا تتحمل ادارة التطبیق اي مسئولیة جراء ماینتج عنھا من اضرار.</p>\r\n\r\n<p>3- یعتمد التطبیق على الخارطة في تحدید موقع الوظائف وقرب الباحثین عن عمل منھا . لذا تم ترك حریة تحدید الموقع على الخارطة للمستخدم نفسھ سواء اختار تحدید موقعھ الفعلي او موقع اخر من خلال تحریك المؤشر على الخارطة . وبھذا یكون المستخدم ھو المسئول عن تحدید الموقع ولا تتحمل ادارة التطبیق اي مسئولیة جراء ذلك . ) للاستفادة من مزایا التطبیق في حال اختار المستخدم تحریك المؤشر الى موقع اخر نقترح ان یكون مكان عام قریب من موقعھ كحدیقة عامھ او ماشابھ (</p>\r\n\r\n<p><strong>موافقتك تعني الالتزام بالشروط التالیة : </strong></p>\r\n\r\n<p>- المصداقیة في تعبئة البیانات وتكون مسؤو ًلا عن الصور والمحتوى الذي تقوم بنشره ، والتأكد من قانونیتھ وملاءمتھ. - أن تلتزم بعدم انتھاك حقوق وخصوصیة الاخرین وأن تكون جمیع رسائل المحادثة ضمن حدود الوظیفة )تحت طائلة المسئولیة( - في حال مخالفة الشروط یحق لادارة التطبیق ایقاف العضویة - یجب تحدیث الاعلان عن وظیفة اولا باول حتى لا یتم حذفھ - لكل مسمى وظیفة یجب تعبئة بیانات اعلان عن وظیفة خاص ب